"policy_refunds": "Please contact me if you receive a product you are not pleased with or if you have questions. I want you to be completely satisfied with your purchase.\r\n\r\nRefunds are only issued upon return of the merchandise. Please purchase delivery confirmation for your return package and let me know it is on the way back. Your refund will be completed upon receipt of the package with the merchandise in as new condition. We do not refund for express shipping.\r\n\r\nI reserve the right to not accept a return on large orders. I am a small individual business, not a large corporation. Please consider carefully before placing orders over $75. Custom orders are non-refundable.",
