"title": "SUPER fast shipping from Florida",
"announcement": "Personalized pet ID tags, a custom personalized keychain set, a mommy or grandma necklace, bridesmaid necklaces, groomsmen gifts, or just a hand stamped necklace, Hayden and Grace is here to help you fulfill that need. \r\n \r\n♥ SHIPPING UPGRADE ♥ \r\nYou have a choice of shipping methods. These can be found when you go to checkout. \r\n IF YOU CHOOSE PRIORITY, and you live in the USA,  you know that your package is insured for $50. Express shipping gives $100 free insurance to USA customers. \r\nI&#39;m been told that the Etsy mobile app does not allow you to change your shipping preferences so either contact me BEFORE ordering or order thru a normal computer. \r\n \r\n♥ TURN AROUND ♥  \r\n Pretty quick!!!  Soldered items take a bit longer but most of my simple hand stamped items usually go out within 3 days!  WE DO NOT WORK THIS STORE ON WEEKENDS. M-F from 8am to 5:00pm is our work schedule, If you purchase a READY TO SHIP item, you must do so before 8:00 am EST M-F to have it shipped out that day. If it&#39;s after 8am it will go out on the following business day.\r\n\r\n♥ OTHER IMPORTANT STUFF ♥\r\nYou must be specific about your order. If our primary picture, for example, shows that everything is in all CAPS, and on your order you put all lowercase letters, we will still put in all caps unless you specify that you would like all lowercase. Please do not assume that we can stamp things EXACTLY what you typed on the order. We have several employees and we have set guidelines for them to follow so if you want to make sure your item is EXACTLY how you want it, tell us EXACTLY how you want it.\r\n\r\n♥ RUSH OPTION AVAILABLE ♥ \r\nSee here: https://www.etsy.com/listing/206502895/rush-my-order-for-die-cut-metal?ref=shop_home_active_2\r\n\r\n♥ TWEET ME ♥ \r\nhttp://www.twitter.com/diecutmetal\r\n\r\n♥ TREASURY LIST ♥ \r\n  http://www.etsy.com/people/DieCutMetal/treasury?sort=creation_date&order=desc\r\n\r\n♥TRADE FRIENDLY ♥\r\nI will trade for...doggie sweaters, pottery, home accents, garden sculptures, cat stuff, soaps, candles, anything in my favorites list: http://www.etsy.com/people/DieCutMetal/favorites?ref=si_fav\r\nConvo me if you see something you want in my store and think you might have something I might want in your store :-) Bartering is the best!\r\n\r\n♥ FACEBOOK ♥\r\n www.facebook.com/haydenandgrace\r\n \r\n \r\n♥ PINTEREST ♥\r\n  http://www.pinterest.com/diecutmetal\r\n\r\n♥ I have 3 stores here on Etsy:\r\nhttp://www.diyjewelrysupplies.etsy.com (Artistic supplies for the jewelry artist)\r\nhttp://www.haydenandgrace.etsy.com (Artistic stamped jewelry and pet id tags)\r\nhttp://www.DieCutMetals.etsy.com (die-cut metal stamping blanks)\r\n \r\n If you ever have a question or concern about your item(s) that you ordered from me, please let me know and I will address the situation in the best way possible.\r\n  Thank you for stopping in and browsing and I do hope you find your way here again.\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Hi!\r\n \r\nI thought I could have every order from the 6th out by the 13th but I can&#39;t due to the HUGE order load. I have closed my shop so I can focus on those orders that I&quot;ve made a commitment to. I will have all orders out as soon as possible. If your order has been marked &quot;shipped&quot; on the 13th and you see a tracking number, it WILL BE SHIPPED Friday the 13th or Saturday the 14th.  I have to take off on Saturday to see my grandson&#39;s wife graduate college so I will be out of pocket then but Sunday, I will be back at the workbench stamping and soldering stuff for my employee on Monday morning. \r\nPLEASE, PLEASE, PLEASE understand that I can&#39;t take anymore custom orders. I will ship everything out as soon as possible. Thanks for your understanding. \r\nBonnie",
"sale_message": "Hi! Thank you for choosing handmade! We appreciate your business and value each and every one of our fabulous customers. Our turn around time is about 1 week. This means that we will have your item ready to ship in no less than 7 days after you order. If you have any questions, please ask.  We kindly ask for you to contact us thru Etsy and NOT THRU EMAIL. We do not have the access at times to check our email so it&#39;s better to contact us thru your invoice link. ",
