"policy_welcome": "HI and welcome to Die Cut Metal Creations. Please take a moment to read my policies and if you have any questions, please contact me thru Etsy.\r\nEach item ordered thru this store is handmade using the highest quality materials available. I cut out about 85% of my flat metal shapes USING A DIE-SYSTEM.   I am open to custom orders and am here to provide you with  top quality items. Oh...and yes, I wholesale ",
"policy_payment": "I take all major credit cards and paypal as a sufficient payment. I often will trade my products for another shop owner&#39;s products but I always follow the Etsy rules regarding this. Convo me for more details if you are unsure how this works. Since you found me on Etsy, please do not ask if I will send you a paypal invoice or go around Etsy. That is called fee avoidance and my shop could be terminated and I would kick my self into oblivion if that ever happened; so save yourself the time :-)\r\n\r\n",
"policy_shipping": "I ship thru the US postal office. \r\n\r\nYOU GET TO CHOOSE your OWN shipping method at checkout. I offer first class, priority, and priority express (even for international).  I&#39;ve been told that if you use the Etsy mobile app that you will not be able to choose this...that it will automatically default to 1st class so if you want one of the other 2 options and you do not have access to a home computer...you need to contact me for a reserved listing until Etsy gets this resolved. \r\n\r\n  I cannot control the postal service and cannot be held responsible for postal delays, failures, thefts, losses or holdups at the customs office OR FOR MAIL THAT&#39;S been damaged. IF YOU PURCHASE PRIORITY or EXPRESS, you get $50 FREE INSURANCE. It&#39;s well worth it, in my opinion. Plus...a little better packaging. \r\n\r\nI don&#39;t provide insurance for your package but if you would like to purchase it, please let me know ASAP or just choose priority as your shipping option. \r\n\r\nI also send a shipment confirmation with every single package I ship along with tracking information. Etsy automatically sends this for me to the e-mail address you provide on your Etsy account as soon as I print a label off of Etsy. \r\n\r\n\r\nMy shipping time is inside of each listing in the link under the picture. It varies from time to time but I do have a full time shop assistant and it&#39;s almost always no longer than a week. \r\n\r\nLast but not least, I will have to recharge you if a package is returned to me for insufficient address or any other reason that is not my fault. ",
"policy_refunds": "My items are custom made just for your or your pet. I will only refund you if I cannot replace the item that I&#39;ve made a mistake on. I know mistakes happen and if I send you something stamped incorrectly with the wrong information, I will gladly remake the item and ship it at my expense. I will not overnight an item to meet a deadline.\r\n\r\nPLEASE, PLEASE, PLEASE read the instructions in each listing. Our prices are super low and if you force me to have to contact you because you failed to read the character limits on a tag, for example, it will eventually force our prices up. We want to remain the place where customer&#39;s can come for a great quality, inexpensive gift or necessary pet id tag when the need arises. I will NOT refund you because of your mistake. I will give you store credit, but will not refund.\r\n\r\nOnce again, I am not responsible for lost or damaged packages. It is up to you, the customer, to request insurance if you feel the need. Please contact me BEFORE an order is placed.\r\n\r\nSince I cut most of my own pieces, I WILL NOT CANCEL AN ORDER unless I haven&#39;t already started preparing it. Each item ordered from DCM Creations is made at time of order. Every morning, I print out my orders and create work trays and prepare a cut list of pieces that I need to fulfill my daily orders. I then send my cut list to my metal cutter each morning. One of my workers gathers the pieces (if they have them ready) and then cuts and deburrs the rest that evening making them ready the following day. If your pieces have already been pulled from stock and/or cut, I will not issue a refund. \r\n\r\nWe put a lot of work into each and every order and we sincerely hope you appreciate the care we put into your handmade items. We don&#39;t just purchase pieces from other vendors and throw something together, we own the machines and dies to cut out each piece and ARE very careful with each piece that we send out that they meet our high expectations.\r\n\r\n",
"policy_additional": "TURN AROUND:   Almost Immediate!!!  Soldered items take a bit longer (3-7 days) but most of my simple hand stamped items usually go out the same day!  WE DO NOT WORK THIS STORE ON WEEKENDS. M-F from 8am to 5:00pm is our work schedule, If you purchase a READY TO SHIP item, you must do so before 12:00 pm EST M-F to have it shipped out that day. If it&#39;s after 12pm, it will go out on the following business day.\r\n\r\n♥ TWEET ME ♥ \r\nhttp://www.twitter.com/diecutmetal\r\n\r\n♥ TREASURY LIST ♥ \r\n  http://www.etsy.com/people/DieCutMetal/treasury?sort=creation_date&order=desc\r\n\r\n♥TRADE FRIENDLY ♥\r\nI will trade for...doggie sweaters, pottery, home accents, garden sculptures, cat stuff, soaps, candles, anything in my favorites list: http://www.etsy.com/people/DieCutMetal/favorites?ref=si_fav\r\nConvo me if you see something you want in my store and think you might have something I might want in your store :-) Bartering is the best!\r\n\r\n♥ FACEBOOK ♥\r\n www.facebook.com/diecutmetalcreations  \r\n \r\n♥ BLOG ♥\r\n http://www.diecutmetal.wordpress.com\r\n\r\n♥ PINTEREST ♥\r\n  http://www.pinterest.com/diecutmetal\r\n\r\n♥ I have 4 stores here on Etsy:\r\nhttp://www.diyjewelrysupplies.etsy.com (Artistic supplies for the jewelry artist)\r\nhttp://www.DieCutMetalCreations.etsy.com (Artistic stamped jewelry and pet id tags)\r\nhttp://www.DieCutMetals.etsy.com (die-cut metal stamping blanks)\r\nhttp://www.thecomicqueen.etsy.com (Handstamped Geekery at it&#39;s best)\r\n\r\n If you ever have a question or concern about your item(s) that you ordered from me, please let me know and I will address the situation in the best way possible.\r\n  Thank you for stopping in and browsing and I do hope you find your way here again.\r\n",
