"title": "Handmade Premium Multi-Wood Guitar Pick - Laser Engraved - Actual Pick Shown - No Stock Photos",
"description": "No stock photos here!  The guitar pick shown is the actual pick you will receive, both sides of the pick are shown, (both sides are engraved), a different design is on each side, see photos. Made with a mix of domestic & exotic hardwoods, Gabon ebony, African leadwood, plum tree wood, & African zebrawood, 4 very beautiful, dense & durable exotic & domestic hardwoods. \nThis premium guitar pick was handcrafted independently, it features a concave thumb groove on each side to ensure a firm grip, & also give the pick an incredible feel of control, the pick also features precision laser engraving with the designs shown, this just adds to the awesome grip that the thumb grooves already provide. \nThe pick measures approx. 1-1/4&quot; or 31 mm long  X  1-1/16&quot; or 26.5 mm wide, it is 3.1 mm thick at the thickest part of the pick, but it feels & plays much thinner due to the concave thumb grooves, the pick tapers down to a thickness of about 1 mm at the tip, & was designed with the guitarist in mind for total comfort & play-ability, the pick is treated with a Danish oil finish, for lasting protection I let the pick soak in the oil to ensure that the pick is deeply penetrated, this is done both before & after the engraving is done, a great all-around guitar pick for use with electric, or acoustic guitars. \nFor some guitarists it may take a while to get used to playing with a wooden pick, but every guitar player that I know, simply can&#39;t live without their hardwood guitar picks once put to the test. So take your guitar playing to new levels, with the unmatched performance, & the true tones that my handmade Artisan wood picks deliver. They also make unique & exceptional gifts!  Thanks for looking!\n\nAbout the woods used...\n\nGABON EBONY - Diospyros Crassiflora - The tree is native to Gabon and grows throughout Southern Nigeria, Cameroon, and Zaire. Gabon Ebony is said to be &quot;the blackest wood in the world,&quot; although it does sometimes contain brown highlights. The wood is quite hard, heavy, and dense, the combination of jet-black appearance and hardness makes it a particular favorite among musical instrument makers , the wood is widely used to make keys for pianos and harpsichords, as well as fingerboards for guitars, violins, cellos, and oboes. Ebony wood has been coveted by wood artisans for literally thousands of years; in fact, some carved pieces have been discovered in Ancient Egyptian tombs. The wood&#39;s distinct coloring and ability to polish beautifully have kept it highly sought after through the ages.\n\nAFRICAN LEADWOOD - Species: Combretum schumanii - Family: Combretaceae \nThe tree is native to South Africa. The heartwood is dark brown, sometimes close to black, with straight to interlocked grain pattern. A very hard, dense and heavy wood with excellent working qualities. Turns and finishes excellent and takes a brilliant polish directly from the tool, and it also has a very nice chatoyance quality. \n\nPlum Tree wood - I do not know the actual genus of the plum tree wood that was used, but the tree which is no longer living, is in my own back yard, It was a big tree that I partially cut up for firewood, the wood was seasoned for over 4 years now, and will make some nice stock for more guitar picks, if i don&#39;t use it all first for some tasty bar-b-que cooking wood!\n\nZEBRAWOOD - Microberlina Brazzavillensis - Tree is Native to Africa. It grows primarily on the river banks of West Africa. This beautiful exotic hardwood is pale golden brown to pinkish-brown with pronounced dark brown streaks giving the quartered surfaces a zebra-stripe appearance. The grain is interlocked. This wood has a coarse texture and lustrous surface. Zebrawood is not only very beautiful, but is also heavy, hard, and strong.\n\nGP-1447",
