"policy_welcome": "Welcome to NuevoWoodcrafts! \r\n\r\nPlease read the entire listing description, as there is much information about each item that is listed. If you still have questions you want answered, feel free to ask!\r\n\r\nIf you are wanting a custom engraved guitar pick, please do not purchase any pick that is already listed in my shop, those guitar picks are for sale as is.\r\nIf you want a custom guitar pick, I first have to go over with you all of the details about your custom order, I can then give you an accurate price quote & time frame, then I can make your custom piece, & finally, I can list it just for you to actually place the order, & make the purchase.\r\n\r\n***Custom Order Requests***  Please include as much info. as possible, such as, wood type (Browse my shop for wood types or ideas), do you want your pick with, or without thumb grooves, do you want engraving on one side, or both sides of the pick, how do you want the basic lay-out of your text, if you have a logo or artwork, include it in your message. You can ask me to show you some font examples that I use regularly at any time. Thank You!\r\n\r\nYou can send me a conversation directly from your PURCHASES page. To do this, click You &gt; Purchases & Reviews and find your order. Click Contact the Shop on the right side of the page. \r\n\r\nYou can also contact me from your RECEIPT page. Click You &gt; Purchases & Reviews and the View Receipt button on the right side of the page. Then click Contact the Shop.  \r\n\r\nYour total satisfaction is guaranteed for anything that you purchase from NuevoWoodcrafts.\r\n\r\nThank You!\r\n\r\n©2014 NuevoWoodcrafts. All Rights Reserved.\r\nAll images, photos, and content of NuevoWoodcrafts listings and items are not to be used without express written permission or consent.",
"policy_payment": "Payment is expected within (1) day of actual purchase date.\r\nSorry I do not accept check or money order as a form of payment. I will only be accepting payment through Pay-Pal, and through Etsy&#39;s direct check-out, with a credit card. You do not need a pay-pal account to pay through Pay-pal with your credit card, just follow the easy payment instructions to pay by credit card on the pay-pal web-site.\r\n& you do not need a pay-pal account when paying with Etsy&#39;s direct check-out.\r\nThank You!",
"policy_shipping": "I will usually ship by USPS, First Class Mail. If you would like for me to ship by Priority Mail, you can simply choose the upgrade option for Priority mail at check-out. I do not ship by Express Mail, But if you are willing to pay for the additional expense, please Convo me before you purchase any item to go over your options on actual shipping costs, so that I can edit a listing to adjust for Express Mail delivery costs.\r\nI may choose altogether not to ship by Express mail, as this form of shipment is not convenient for a one man shop.\r\nIf the item, or items you purchase weigh more than 16 OZ., I will automatically ship by Priority Mail, cost may increase a bit, but not always.\r\nOn occasion I will ship using UPS, but only if  what I am sending requires a large package.\r\n\r\n***INTERNATIONAL SHIPMENTS***  Guitar picks will ship by International First Class Mail, If you would like for me to ship by Priority Mail International, you can simply choose the upgrade option for Priority mail at check-out.\r\nFor urgent packages that require Express Mail shipping, the same applies as above, I will need to send you an actual quote to be agreed upon before I edit any listing to adjust the shipping cost. \r\n\r\n***PLEASE BE AWARE***  I AM NOT RESPONSIBLE FOR ANY CUSTOMS DELAYS OR ADDITIONAL COSTS WHICH MAY, OR MAY NOT INCUR, I WILL SHIP USING THE ADDRESS THAT YOU SUPPLY, IF YOU DO NOT ASK FOR INSURANCE AND AGREE TO PAY FOR IT, I WILL NOT INSURE YOUR PACKAGE, AND IF YOUR PACKAGE IS LOST OR NOT DELIVERED, I MAY, OR MAY NOT, REFUND YOUR PURCHASE PRICE, THIS I WILL DECIDE ON A CASE PER CASE BASIS.  Thank You!",
"policy_refunds": "You may return your item/s for a refund or exchange within (30) days after you receive your purchased item/s for any reason. All returned items must be in the same condition as you received them, or it, (unless damaged or broken during shipment), in this case, I will work with you to replace the item/s, or refund you your total cost, but you will need to photograph any item if it was received broken or damaged, & send it to me, in order to verify your claim. \r\nI will always work with you, to your total satisfaction!\r\nThank You!",
"policy_additional": "I do not wholesale any items, nor do I do consignment.\r\nPlease don&#39;t ask!\r\n\r\n©2014 NuevoWoodcrafts. All Rights Reserved.\r\nAll images, photos, and content of NuevoWoodcrafts listings and items are not to be used without express written permission or consent.",
