"title": "Handmade Premium Wood Guitar Pick - Afzelia Xylay - Actual Pick Shown - No Stock Photos",
"description": "No stock photos here!  The guitar pick shown is the actual pick you will receive, both sides are shown, (both sides are engraved), the same Dad design is on each side, see photos. Made of Afzelia Xylay, a very beautiful, dense & durable exotic hardwood. \nThis premium guitar pick was meticulously handcrafted independently, it features a concave thumb groove on each side to ensure a firm grip, & also give the pick an incredible feel of control, the laser engraving just adds to the awesome grip that the thumb grooves already provide. \nThe pick measures approx. 1-1/4&quot; or 31.3 mm long  X  just over 1&quot; or 26.1 mm wide, it is 3.3 mm thick at the thickest part of the pick, but it feels & plays much thinner due to the rough sanded concave thumb grooves, the pick tapers down to a thickness of about 1 mm at the tip, & was designed with the guitarist in mind for total comfort & play-ability, the pick is treated with a Danish oil finish, for lasting protection I let the pick soak in the oil to ensure that the pick is deeply penetrated, this is done both before & after the engraving is done, a great all-around guitar pick for use with acoustic, or electric guitars.\nFor some guitarists it may take a while to get used to playing with a wooden pick, but every guitar player that I know, simply can&#39;t live without their hardwood guitar picks once put to the test. So take your guitar playing to new levels, with the unmatched performance, & the true tones that my handmade Artisan wood picks deliver. They also make unique & exceptional gifts!  Thanks for looking!\n\nAbout the wood used...\n\nAFZELIA XYLAY – (Afzelia xylocarpa) - The tree is native to Southeast Asia, & grows throughout Cambodia, Laos,Thailand. Vietnam, & Myanmar, formerly known as Burma. This species of wood can exhibit incredible figure, and is also known as alligator skin, a relatively dense wood that can range in color from yellowish orange, to tan & brown, and sometimes very dark brown to nearly black streaks running through it. This wood can very easily trick the eye into thinking that the wood is somewhat rough, while being glassy smooth, a truly unique & beautiful exotic wood.\n\nGP-1457",
