"title": null,
"announcement": "Welcome to OnePickPony where I offer the highest quality guitar picks with the widest variety of styles and fonts.  My guitar picks are heirloom quality and will be cherished gifts for years to come.  Serious about my quality, ONLY 14, 16 and 18 gauge metals are used.  No thin picks in the 20&#39;s here!!  I am also the first shop to offer BRONZE!!!  Shop around, but be sure to ask about gauge.  And I never charge for beautiful packaging and each item will be individually gift wrapped.  I want you to give a gift that makes us both proud!  I strive to give the same great quality and service my sister store, www.TheLandlockedDogTwo.Etsy.com is known for.  \r\n  \r\nHere are a few items of interest that will enhance your shopping experience:\r\n\r\n****Guitar Picks are currently being shipped out within 5 business days of purchase :)  Items are only to be shipped to address given as shipping address upon purchase.\r\n\r\n*****Please take a moment to read Shipping and Return Policies prior to purchasing from OnePickPony.  \r\n\r\n****If you should have any questions or concerns regarding your purchase, please check out my shop policies; there you will find answers to many of your questions.  Still have questions or wish to discuss a custom order?  Please contact me through Etsy Convo ONLY.  I do not answer emails regarding orders as Etsy requires a convo trail should problems arise and does not take into consideration personal emails.\r\n\r\n****Need a rush order?  Priority and Express packages are available in the &quot;Add Ons&quot; section of the shop.  Feel free to convo me with any questions you may have.  \r\n\r\n****I love to work with customers on creating just the right item for their tastes.  Please feel free to convo me with any ideas or variations that you may have.  Custom work is what I like doing best!\r\n\r\nThank you for checking out my shop.  I love what I do and hope that you do too!",
