"vacation_message": "We will be closing the shop to catch up orders and add products to our line.  Thank you for your support of small businesses.  \r\n\r\nFor a full line of custom gifts for all occasions, be sure to visit our sister shop, TheLandlockedDogTwo@Etsy.com  \r\n\r\nAll orders taken prior to Valentines Day will ship in time.  :-)\r\n\r\n\r\n\r\n",
