"policy_welcome": "Welcome to OnePickPony, your choice for heirloom quality guitar picks for every occasion of your life.  Picks are currently being produced within 7 days.",
"policy_payment": "OnePickPony accepts Paypal and credit cards.  We respectively ask that payment be made at time of purchase.  Thank you in advance :)  Due to the nature of custom orders, cancellations will only be accepted with 48 hours of ordering ONLY IF PRODUCTION OF ITEM HAS NOT BEGUN.",
"policy_shipping": "All shipping is done through USPS Mail. Guitar Picks are mailed 1st class with tracking. I can make sure your order is shipped out on time but unfortunately I cannot control the postal service and cannot be held responsible for postal delays, failures, thefts, losses. OnePickPony does not assume responsibility for any item that is confirmed delivered by the USPS. \r\n\r\n Per Etsy and Paypal policies, items will be shipped only to the address you&#39;ve entered at checkout. Once an order has been submitted, the shipping address cannot be changed if it is different than the billing address. You may cancel the existing order, provided that it has not been processed for shipping, and place a new order with a different shipping destination. \r\n\r\nIf item is returned to OnePickPony due to address issues, the customer will be responsible to pay postage prior to shipping to a corrected address.  OnePickPony uses an automatic labelling system which uses the address customer provided.\r\n\r\n Tracking is not available for out of country shipping. While not the norm, overseas shipping can take up to six weeks. You will be emailed a customs number upon shipment.  I can only show proof of mailing for out of country orders and cannot be held responsible for any shipping problems. To ensure timely delivery and tracking, it is always advised to use Priority shipping.\r\n\r\n In accordance with the law, all international orders will have full value declared on customs forms. Import duties, VAT taxes, and charges are NOT included in the item price or shipping cost, as these charges are the buyer&#39;s responsibility. We recommend checking with your country&#39;s customs office to determine what additional costs will be prior to buying. OnePickPony will not refund items that that have been refused for non-payment of import taxes.\r\n\r\n Overnight & Priority shipping is always available for an extra fee.\r\n",
"policy_refunds": "Due to the nature of custom items, returns are not accepted unless there is a quality issue or misspelling.  Hand stamped items may have tiny flaws such as slightly irregular spacing, variations in stamping depth, etc. and should be viewed as qualities that make your piece unique. Refunds will only be given upon return of item.   On custom orders character amounts vary from piece to piece and item may not be able to set up exactly as shown in pictures or as requested; OnePickPony will do so at their discretion to make the item most attractive. \r\n\r\nAbsolutely no refunds, for any reason, after 30 days of shipping. \r\n\r\nOnePickPony is not responsible for any item not received if shown delivered by the USPS nor non-delivered international orders.",
