"accepts_custom_requests": true,
"policy_welcome": "Hi, Welcome to &quot; Wag tag &quot; Etsy store! \r\nWag tag are 100％ made in Japan, handmade from high-quality brass and nickel silver and stamped with pet’s name.　\r\nThey’re very strong and tough. \r\nYou can enter a name, phone number and symbol mark. \r\nCustomize your own!\r\n\r\nWe hope that help lost dogs find their way home.\r\nCustom ID Tags are an important way to identify your dog in case he ever gets lost.\r\n\r\nPlease be sure to read all policies carefully prior to ordering. \r\nIf you have any questions, don’t hesitate to contact us.\r\n\r\nWe hope you will enjoy our items and shop.\r\n\r\nhttp://www.pettys.jp/",
"policy_payment": "We will take payments in Paypal only.\r\nYou do not need a Paypal account in order to purchase, you can pay with your credit card through the Paypal website.\r\nIf no payment is received and I can not contact you within 7 days, we will cancel the order.",
"policy_shipping": "All tags are made to order.\r\nWe ship orders within 3-5 business days from Japan.\r\nWe normally use International Mail by Japan Post after receipt of PayPal payment.\r\n\r\n［shipping method］\r\n*** e-packet ***(normal)\r\nAll of my items are shipped by Japan postal international &quot;e-packet&quot;.It costs $5.\r\nRegistered mail with tracking code is possible in some countries. \r\nTypically such packets arrive in 1-2 weeks.\r\n（* I&#39;m sorry ,but the tracking system of e-packet doesn&#39;t covered on following countries.Australia, Israel,e.t.c.）\r\n\r\n*** EMS ***\r\nIf you need your order in a rush, the EMS (Express Mail Service) shipping is available.\r\nEMS arrives in 3-5 days and gets registered mail and a tracking number. \r\n\r\nIt is very sure and speedy shipping method but costs $10.\r\nIf you want to upgrade the shipping to EMS, please choose EMS in your cart.\r\n\r\nDuty/Import taxes are the responsibility of the customer.\r\n\r\n\r\n日本国内への発送は、日本郵便のクリックポストでお送りします。($1)\r\nお急ぎの場合はヤマト運輸の宅急便でお送りしますので、カートに入れた後にアップグレードを選択してください。（$5）",
"policy_refunds": "If for any reason you are unhappy with your purchase, please contact us.\r\nYou may return it within 14 business days for a full refund (not including shipping costs).\r\n",
