"description": "This electric guitar tie is printed on cream, silver and red ties with black ink. This self tie necktie is the perfect size for boys between 8 to 13 years of age.\r\n\r\nI use eco-friendly water based ink to print on soft microfiber ties. The listing is for one tie only.\r\n\t\r\nFeatures\r\nSelf-tie style\r\n3&quot; width, at the widest point\r\n48&quot; length, tip to tip\r\nRecommended size for boys 8- to 13-years old\r\n\r\n-----------------------------------------------------------------------------------------------\r\n\r\nSHIPPING...\r\nI will ship your purchase as fast as possible, usually within two business days. Once in a while it can take up to 5 business days but I will contact you to let you know.\r\n\r\nDue to high shipping costs from Canada I ship with regular mail and cannot provide a tracking number.\r\n\r\nUSA: Shipping from Canada to the USA takes around 5 to 14 business days\r\nCanada: Shipping from Canada takes around 3 to 8 business days\r\nInternational: Shipping from Canada to international destinations take 7 to 21 business days\r\n\r\nShipping times depend on a variety of reasons that are completely out of my control. I will not issue a refund for packages that are delayed in the mail. \r\n\r\nREFUND...\r\n\r\nFor all exchanges you pay the shipping to return it to me, and when I receive it, I will pay the shipping to send you the replacement.\r\n\r\nAll refunds are minus shipping costs. If I have made an error with your order then I will pay shipping to return the incorrect item and to replace it with a new one.\r\n\r\n-----------------------------------------------------------------------------------------------\r\n\r\nThank you for viewing my store. If you have any questions, feel free to contact me. I try to respond to emails as quickly as possible. I look forward to printing your order.\r\n\r\nVisit us at:\r\nhttp://www.etsy.com/shop/IceOrchid",
