"title": "Professional Custom Engraved Guitar Pick / Plectrum. African Ebony wood. Felt gift bag included.",
"description": "Professional custom engraved guitar pick. African ebony wood. Free hand-stitched felt keyring holder.\n\nWe custom engrave Timber Tones guitar picks, a British leader in the industry, because of their incredible quality and eco-friendly ethics. These are not cheap picks that break easily, they are a professional standard used in the music world. We then laser engrave at 600dpi for absolute precision and clarity.\n\nHOW TO BUY:\n\na) Choose to engrave either one or both sides of your pick (we suggest no more than 7 or 8 words per side, ideally 4-7).\n- &#39;One side&#39; means the reverse is kept blank.\n- &#39;Both sides&#39; means you can have either the same or a different message on each side.\nb) Add your engraving as a &#39;Note to CustomMusicGifts&#39; during checkout.\n\nCalisto MT font is used - it is a medium thickness serif font that looks and engraves excellently, as seen in the examples. The pick has a flat thumb area on both sides, enabling a comfortable grip and serving as the area for engraving.\n\n----------------------\n\nAfrican Ebony is an extremely hard wood with a very close grained timber that polishes to a smooth finish, ensuring a clean crisp sound. It is also the wood of choice for many guitar manufacturers, who use its pure black appearance to manufacture finger boards, bridge pins and machine head buttons.\n\nThe wood is obtained from the Diospyros Mespilifomis tree, a large deciduous tree found mostly in the savannas of Africa.\n\nRECOMMENDED FOR:\n- Electric guitar\n- Acoustic guitar (dramatic brightening)\n\nALSO CONSIDER:\n- Lignum Vitae: https://www.etsy.com/uk/listing/192898849/custom-engraved-guitar-pick-plectrum\n\n\n----------------------\n\nCHOOSING THE RIGHT PICK:\nCustom pick section: https://www.etsy.com/uk/shop/CustomMusicGifts?section_id=15608540\n\nAcoustic guitar:\nEbony (dramatic brightening)\nBuffalo Bone (strong brightening)\nBeech and Ebony Combo (strong brightening)\nMother of Pearl (black) (medium brightening)\nMother of Pearl (red) (medium brightening)\nJatoba (medium brightening)\nAfrican Sapele (medium brightening)\nCocobolo (medium brightening)\nBloodwood (subtle brightening)\nAfrican Mahogany (nylon strung)\nSantos Rosewood (Blues and Jazz)\n\nBass guitar:\nLignum Vitae\nEbony (shredding)\n\nClassical guitar:\nCocobolo\nAfrican Mahogany\n\nElectric guitar:\nEbony\nBloodwood\nSantos Rosewood\nJatoba (Blues and Jazz)\nBeech and Ebony Combo\nMother of Pearl (black)\nMother of Pearl (red)\nAnodised Aluminium (black)\nAnodised Aluminium (red)\nBuffalo Bone",
