"announcement": "Handstamped jewelry and personalized name necklaces, hand stamped gifts, gifts for men, and wedding jewelry\r\n -All Ship in 1 Business Day- Coupon code SCHOOLSOUT receives 5% off purchase!\r\nWe create handmade gifts for men, women, girls, Grandma, and more.  In our 5 years of business, we&#39;ve created jewelry and favors for wedding parties, countless sports necklaces for school teams, and lots of mommy jewellery.\r\nDistinctlyIvy has experience with shipping worldwide and as one of the top selling jewelry shops on Etsy, we pride ourselves in making your buying experience fun and easy!\r\nContact us today - we respond immediately: https://www.etsy.com/conversations/new?with_id=8795545 or support@DistinctlyIvy.com\r\n\r\n-------------------------------------------\r\nCURRENT PROCESSING TIME\r\n✤ We Ship in 1 Business Day all over the world!! ✤\r\n\r\n\r\n-------------------------------------------\r\nCURRENT SALES\r\nUse coupon code SCHOOLSOUT for 5% off your purchase!\r\n\r\n\r\n-------------------------------------------\r\nABOUT US\r\nTie bars, wedding orders, sports team jewelry, keychains - special orders welcome.\r\nCustom mommy gift jewellery, keychains, engraved guitar picks for men too!\r\nGreat gifts for any person or occasion - we have lots of personalized items, all handmade by me in Spokane, WA.\r\n\r\nVisit our sterling silver shop at IvyByDesign http://IvyByDesign.etsy.com\r\n\r\n\r\n-------------------------------------------\r\nPOLICIES\r\nPlease read before purchasing https://www.etsy.com/shop/DistinctlyIvy/policy\r\n\r\n\r\n-------------------------------------------\r\nBULK DISCOUNTS\r\n✤ Buy 10 or more of the same item and receive 10% off your purchase!\r\nPurchase 20 or more of the same item and receive 15% off.\r\nAsk me about this and I&#39;ll create you an item with the special pricing to order. ✤\r\n\r\n\r\n-------------------------------------------\r\nCONTACT ME\r\nIf you don&#39;t see what you&#39;re looking for, please send me a message on Etsy or email me at support@distinctlyivy.com.  I would be more than happy to work with you.\r\n\r\nProduction hours are Monday - Friday 7AM - 4PM PST\r\nCustomer Service hours are 7 days a week, 7AM - 5PM PST\r\n\r\nDon&#39;t like to email? It&#39;s not our favorite either but we do encourage it so we can easily share links to items, pictures, and listings.  If you&#39;d like to call, contact us at 509.220.4351\r\nPlease leave a message if we don&#39;t answer so we can get right back to you.\r\n\r\nCheck often for new personalized jewelry as I add new styles all the time\r\nhttp://www.etsy.com/shop/distinctlyivy\r\n\r\nSUBSCRIBE to the DistinctlyIvy mailing list and be the first to hear about sales and discounts: http://bit.ly/mIt9n9\r\n\r\n\r\n-------------------------------------------\r\nFAQs\r\nVisit my FAQ page here: http://distinctlyivy.myshopify.com/pages/faqs\r\n\r\n\r\n-------------------------------------------\r\nSOCIAL MEDIA / MORE LINKS\r\n\r\n{New to Etsy?} Here&#39;s a helpful link: http://www.etsy.com/help_guide_checkout.php\r\n\r\nFor update on new items and sales, please &quot;LIKE&quot;, share and follow us on:\r\nFacebook - /DistinctlyIvy\r\n#DistinctlyIvy - Instagram\r\n@DistinctlyIvy - Pinterest",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your order!\r\n\r\nDid you include any needed personalizations in the note box when you checked out?  If not, please message me on Etsy the names/words, crystal colors, etc. so I can send your package quickly.  You can also email me at support@DistinctlyIvy.com\r\n \r\nImportant:  Multiple items come shipped together in ONE gift box unless extra boxes are purchased for individual gift items.  Please contact me as soon as possible if you would like to add any gift boxes to your order. \r\n\r\nDistinctlyIvy ships out next business day.\r\nShipping within the US with First Class shipping takes 3-5 business days; international orders take 2-3 weeks to arrive.\r\n\r\nDistinctlyIvy on SOCIAL MEDIA\r\nFor update on new items and sales, please &quot;LIKE&quot;, share and follow us on:\r\n- Facebook\r\n- Instagram\r\n- Pinterest\r\n@distinctlyivy #distinctlyivy\r\n\r\nUse IMBACK as a coupon code next time you checkout to receive 5% off your next purchase!\r\n\r\nSubscribe to my monthly newsletter and be the first to find out about sales\r\nhttp://bit.ly/mIt9n9\r\n\r\nIf you have any questions, please send me a message and I will get back to you as soon as possible. \r\n\r\nThank you!  Ivy",
"digital_sale_message": null,
