"policy_refunds": "We want you to Love Your Purchase! \r\n\r\nReturns should be initiated within 7 days of delivery. \r\n\r\nWe use Shipsaver Insurance at our own expense whenever it seems like a good idea~ if things arrive damaged please save the shipping materials and be prepared to supply photographs for the insurance process.\r\n\r\nWe want you to LOvE yOur PuRchAse :)",
"policy_additional": "We try our best to photograph and describe our items as fully as possible, but if you need more information don&#39;t hesitate to ask questions. Always happy to combine shipping, just ask!\r\n\r\nWe don&#39;t do special orders, sorry!  We are happy to take suggestions however, and if you missed out on a bed or closet in a certain color we are happy to put it at the top of our &quot;make next&quot; list and let you know when another is available.  Not everything can be duplicated, and since these are all handcrafted no two will be exactly the same. ",
