"sale_message": "Hi and Thanks for ordering.\r\n\r\nPlease check your email for tracking confirmation. There&#39;s usually a 2-4 day lag between when you receive this shipping notice and your order becomes trackable. Please be patient and give it some time to show up in the USPS&#39; system.\r\n\r\n",
