"login_name": "matteapolis",
"accepts_custom_requests": false,
"policy_welcome": "Hi and thanks for ordering. \r\nI&#39;m a 40 year old headbanging metal punk rocker who&#39;s been listening to underground punk and metal since the 80s. I love collecting punk and metal records, cult cinema, motorcycles, good vegan/vegetarian food, and travel. \r\nI have a cat named Nuclear Winter who helps out in the shop and occasionally leaves hair on your shirts. \r\nI&#39;m the sole person behind Through The Mist.",
