"policy_shipping": "All domestic order are sent via 1st Class Mail and have tracking. Tracking info/confirmation is sent to your email provided by Etsy, so check there to find the tracking number before contacting me. \r\n\r\nEvery order leaving the US is sent 1st Class International and insured. This is to cover both of our asses.\r\n\r\nSometimes orders can take a while to get printed and shipped due to all kids of factors. I almost always have orders in the mail within 10 business days, but sometimes shit happens. If you have any questions or concerns that your order is taking too long to ship, just send me a message and I&#39;ll let you know what&#39;s happening.",
