"policy_payment": "I ONLY accept PayPal as payment. \r\n\r\n If you are local - a cash payment can be arranged.\r\n\r\nI give customers 7 days to make payment on purchased items.  After that time I will cancel the order unless you contact me and make arrangements.  \r\n\r\nIf your order does get cancelled, you may RE-ORDER at anytime.\r\n\r\nThanks for your understanding!\r\nLiz",
"policy_shipping": "I try to keep shipping as low as possible.  If your shipping is more than what I pay - I will refund the difference.  Please let me know in the invoice notes.\r\n\r\nMy shipping charges reflect the cost of packaging, postage and fees.\r\n\r\nI strive to mail out all items purchased within 4 business days(Monday-Friday). During the RUSH months of September through December it may take up to 10 days to prepare your order.\r\n\r\nPlease contact me if you need a rush order. We will do our best to help you out.  We are unable to fill RUSH orders during the BUSY season.\r\n\r\nI SHIP TO THE ADDRESS ON Your Paypal Account! Please make sure it is correct. If you want it shipped elsewhere, please leave a MESSAGE in the INVOICE NOTES. \r\n\r\nTracking your Package - US Priority Packages are trackable.\r\n\r\nInternational Packages are only TRACKABLE if they are sent EXPRESS MAIL which is $27.00 for the small box.\r\n\r\n*Note* I don&#39;t intend to make money from shipping. However, shipping costs vary from state to state and country to country, etc. I have tried to set up my shipping costs using an average of all places I ship to. It can be tricky to estimate shipping, especially out of the United States. Larger orders may be more expensive than your invoice states.\r\n\r\nINTERNATIONAL ORDERS\r\nIn our experience, the following countries hold packages for 1-2 weeks in customs or commonly lose them in transport:  I would advise requesting insurance for these countries:\r\n\r\nCANADA\r\nGERMANY\r\nSPAIN\r\n\r\nFirst Class is cheaper and does not get held up in customs as often as more expensive shipping choices.  But this is not trackable.\r\n\r\nIf a package is lost, we do our best to help locate your package or send a replacement.\r\n\r\nPlease don&#39;t be afraid to ask any questions you may have in this regard!**\r\n\r\n***I always send out invoices with orders, this helps us all keep better records and confirm that you&#39;ve received what you ordered.\r\n\r\nThanks!\r\nLiz",
"policy_refunds": "RETURNS:  Please contact me through a CONVO  - not through E-MAIL.  \r\n\r\n1 - ONLY UNSCRATCHED blanks will be accepted for a refund.  Make sure to wrap the blanks tightly to prevent any bumping around in the package, this can cause scratches.  Scratched blanks cannot be refunded because they cannot be resold.\r\n\r\nAny packages, such as rivets, setter kits and some tools -  where the package is sealed at the factory can only be returned if the package is unopened.\r\n\r\n***We will only accept these items as returned if there was a problem with the product.\r\n\r\n2 - Include your invoice letting us know that you would like a Refund.\r\n\r\nAs soon as we receive your items we will refund the price of the blanks.\r\n\r\n\r\n******REFUNDS will be made only after the items are returned in good condition and within 30 days of the date of purchase.",
"policy_additional": "Here&#39;s a run down of the different types of aluminum I have available:\r\n\r\nPURE 1100 ALUMINUM \r\nMy favorite.  It is FOOD SAFE and safe on your skin.  A perfect choice for projects that will come in direct contact with your skin. There are less skin reactions with FOOD SAFE ALUMINUM, than with STERLING SILVER.. \r\n\r\nIt&#39;s available in \r\nSOFT TEMPER \r\nVery soft and great for metal stamping.  Thick cuffs are easy to bend with the SOFT Temper.  It takes a very clear impression and is very gently on your tools.\r\n\r\nor \r\n\r\nHARD TEMPER \r\nStiff metal that will not bend out of shape.  I use the HARD TEMPER for all charms and discs\r\n\r\n************************\r\n\r\n3003 ALUMINUM - stronger but not as pure.  THIS METAL IS MEANT TO BE COVERED OR FINISHED IN SOME WAY BEFORE BEING WORN.\r\n***This is great for covering with fabric or as a BASE for POLYMER clay.\r\n\r\nHope this helps you decide what metal is best for your aluminum discs, aluminum cuffs, or ring blanks at Gotta Getta Deal on ETSY!!!\r\n\r\nHave fun creating!!!\r\nLiz",
